Born into a Polish family (his uncle was a Catholic bishop), he came first in the Riga Championship of 1967, winning all thirteen games.He tied for 1st-3rd at Pärnu 1967. He thrice shared 1st in Latvian Chess Championship (1969, 1974, 1985). Petkēvičs played for Latvia in Chess Olympiads: 
*  In 1994, at first reserve board in the 31st Chess Olympiad in Moscow (+1 –1 =4); 
*  In 1996, at second reserve board in the 32nd Chess Olympiad in Yerevan (+4 –1 =2); 
*  In 1998, at first reserve board in the 33rd Chess Olympiad in Elista (+2 –0 =3). He won the 12th World Senior Chess Championship at Naumburg 2002. Petkēvičs was awarded the International Master (IM) title in 1980, and the GM title in 2002.

The Journal of Clinical Epidemiology is a peer reviewed journal of Epidemiology that promotes the quality of clinical and patient-oriented health services research through the advancement and application of innovative methods of : 
* Conducting and presenting primary research; 
* Synthesizing research results; 
* Disseminating results; and 
* Translating results into optimal clinical practice; 
* With special attention to the training of new generations of scientists and clinical practice leaders. The Journal, published by Elsevier, was previously published as the Journal of Chronic Diseases. The journal was first published in 1955 as a follow-up to Harry S. Truman's 1951 Presidential Task Force on national health concerns and the subsequently written Magnuson Report. This journal aimed to discuss chronic diseases and how they affected all ages, rather than merely the elderly. Furthermore, consistent with the epidemiological transition model, the landscape of the United States' healthcare woes transformed from primarily infectious disease mortality to mortality induced by chronic diseases. Under the editorial leadership of Alvan Feinstein and Walter O. Spitzer, the title of the journal was changed to the Journal of Clinical Epidemiology with the January 1988 issue. The current editors are André Knottnerus (Professor of General Practice, Netherlands School of Primary Care Research, President of the Scientific Council for Government Policy, Maastricht, The Netherlands) and Peter Tugwell (Professor, Department of Medicine, Department of Epidemiology and Community Medicine; Canada Research Chair, Institute of Population Health, University of Ottawa, Ottawa, ON, Canada). According to the Journal Citation Reports, the journal has a 2013 Impact Factor of 5.478, ranking it 6th out of 160 journals in the category "Public, Environmental & Occupational Health" and 1st out of 85 journals in the category "Health Care Sciences & Services".
